import "./ExpenseForm.css";

const ExpenseForm = () => {
    <form>
        <div className="new-expense__controls">
            <div className="new-expense__controls">
                <label>Title</label>
                <input type="text"/>
            </div>
            
        </div>
        <button className="new-expense__actions" type="submit">Add Expense</button>

    </form>
}

export default ExpenseForm;
